// Listagem.js
import React, { useState, useEffect } from 'react';
import { obterSimulacoes } from '../services/api';
import ListagemItem from '../components/ListagemItem'; // Importe o componente de item da listagem

import './Listagem.css';

const Listagem = () => {
  const [simulacoes, setSimulacoes] = useState([]);

  useEffect(() => {
    const fetchSimulacoes = async () => {
      try {
        const data = await obterSimulacoes();
        console.log('Dados retornados pela API:', data);
        setSimulacoes(data);
      } catch (error) {
        console.error('Erro ao buscar simulações:', error);
      }
    };

    fetchSimulacoes();
  }, []);

  return (
    <div>
      <h1>Listagem de Simulações</h1>
      {simulacoes.map((simulacao) => (
        <ListagemItem key={simulacao.id} simulacao={simulacao} />
      ))}
    </div>
  );
};

export default Listagem;
